['from typing import List

def funcImp(arg1: List[int]) -> int:
    if not arg1:
        return 1
    n = len(arg1)
    if 1 not in arg1:
        return 1
    if n == 1:
        return 2 if arg1[0] == 1 else 1
    for i in range(n):
        if arg1[i] <= 0 or arg1[i] > n:
            arg1[i] = 1
    for i in range(n):
        num = abs(arg1[i])
        if num == n:
            arg1[0] = -abs(arg1[0])
        else:
            arg1[num] = -abs(arg1[num])
    for i in range(1, n):
        if arg1[i] > 0:
            return i
    if arg1[0] > 0:
        return n
    return n + 1']

